import React from "react";
import './navbar.css';

export default function Navbar(props){
    return (
        <div className="navbar">
            <a href="https://open.spotify.com/" target="_blank"><img src={require("./spotIcon.png")} alt="Spotify"></img></a>
            <div className="center">
                <h1>SpotMV - Your Music Visualized</h1>
            </div>
            <div className="userProf">
                <a href="open.spotify.com">
                    <h2 href="open.spotify.com">{props.name}</h2>
                    <img src={props.img} className="userImg"></img>
                </a>
            </div>
        </div>
    )
}
